export const getRandomWord = (length = 5) => {
    const words = WORDS_BY_LENGTH[length];
    if (!words || words.length === 0) {
        // Fallback to 5-letter words if no words for specified length
        return WORDS_BY_LENGTH[5][Math.floor(Math.random() * WORDS_BY_LENGTH[5].length)];
    }
    return words[Math.floor(Math.random() * words.length)];
};

export const isValidWord = (word, length) => {
    const validWords = VALID_GUESSES_BY_LENGTH[length];
    if (!validWords) return false;
    return validWords.includes(word.toUpperCase());
};
